import React from 'react';
import { NewGameForm } from '../../components/NewGameForm';
import './styles.css'

export const Homepage = () => {

  return (
    <>
    <div className='home'>
      <h1>Welcome to quizName</h1>

      <div className='rules'>
        <h3>The Rules</h3>
        <p>here are some rules</p>
      </div>
      
      <button>New Game</button>
      <button>Join Game</button>
      <NewGameForm/>
    </div>
      
    </>
  )
}
